import React,{Component} from 'react';
import './App.css';
import Car from './Car/Car'

class App extends Component {
  render(){
    const divStyle = {
      'textAlign' : 'center',
    };
    return(
        <div> style={divStyle}>
          <h1>hello world</h1>
          <Car name={"Audi a8"} year={2008} />
          <Car name={"Volvo 3"} year={2004}>'sfg'</Car>
        </div>

    )

  }
}

export default App;
